import './App.css';
import Header from './Components/Header/Header';
import Footer from './Components/Footer/Footer';
import Main from './Components/Main/Main';
import Nav from './Components/Header/Nav/Nav'
import Section from "./Components/Main/Section/Section";
import Video from './Components/Main/Video/Video';
import {BrowserRouter,Routes,Route} from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
    <div className='wrapper'> 
      {/* <Header/>  */}
      <Header>
        <Nav/>
          {/* <Routes>
             <Route path='Home' element = {<Video/>} ></Route>
             <Route path='about' element = {<Section/>} ></Route>
             <Route path='tutorials' element = {<Footer/>} ></Route>
             <Route path='free' element = {<Header/>} ></Route>
             <Route path='contact' element = {<Main/>} ></Route>
          </Routes> */}
     </Header>

      <Main>
          {/* <Nav/> */}

         <Section/>
         <Routes>
             <Route path='Home' element = {<Nav/>} ></Route>
             <Route path='about' element = {<Section/>} ></Route>
             <Route path='tutorials' element = {<Footer/>} ></Route>
             <Route path='free' element = {<Header/>} ></Route>
             <Route path='contact' element = {<Main/>} ></Route>
          </Routes>
          <Section></Section>
         <Video/>
      </Main>
      <Footer/>
    </div>
    </BrowserRouter>
  );
}

export default App;
